public sealed class SkitteringSubjects : QuestClass
{
	uint satchelId = 140916;
	float satchedRange = 29;
	int spiderId = 105756;
	uint buffId = 210274;
	List<Vector3> hotspots = new List<Vector3>() {
		new Vector3(1493.555, 5384.459, -15.37231, "None"),
		new Vector3(1621.943, 5461.346, -57.94077, "None"),
		new Vector3(1655.537, 5546.796, -57.10014, "None"),
		new Vector3(1688.93, 5611.228, -57.89395, "None"),
	};

	public SkitteringSubjects()
	{
		Name = "Skittering Subjects";
		QuestId.Add(42090);
		Step.AddRange(new[] { 0, 0, 0, 0, 0 });
	}
	static void Log(string text)
	{
		Logging.WriteDebug("[Skittering Subjects] " + text);
	}

	public override bool HasQuest()
	{
		return true;
	}
	public override bool IsCompleted()
	{
		return false;
	}
	public override bool CanConditions()
	{
		return WorldQuest.Can(this);
	}
	public override bool IsComplete()
	{
		return WorldQuest.Complete(this);
	}
	public override bool Pulse()
	{
		if (!ItemsManager.HasItemById(satchelId))
		{
			Log("goto start");
			GoToTask.ToPosition(hotspots[0]);
			return true;
		}
		ResetSettings();
		var spider = Spider();
		if (spider == null)
		{
			var randomHotspot = hotspots[Others.Random(0, hotspots.Count - 1)];
			var pathHotspot = PathFinder.FindPath(randomHotspot);
			Log("go to random hotspot " + randomHotspot);
			MovementManager.Go(pathHotspot);
			while (Spider() == null && MovementManager.InMovement && Conditions.InGameAndConnectedAndAliveAndProductStartedNotInPause && !Conditions.IsAttackedAndCannotIgnore)
			{
				Thread.Sleep(1000);
			}
			return true;
		}

		/*
		if (spider.GetDistance > satchedRange * 2)
		{
			Log("spider too far. blacklist");
			wManager.wManagerSetting.AddBlackList(spider.Guid, 1000 * 2 * 60);
			return true;
		}
		//*/

		var result = false;
		var path = PathFinder.FindPath(spider.Position, out result);
		if (!result || spider.GetDistanceZ > 20)
		{
			Log("unable to find path to spider. blacklist");
			wManager.wManagerSetting.AddBlackList(spider.Guid, 1000 * 2 * 60);
			return true;
		}
		if (spider.HaveBuff(buffId))
		{
			ChangeSettings();
			Log("take spider");
			GoToTask.ToPositionAndIntecractWithNpc(spider.Position, spider.Entry);
			return true;
		}

		if (spider.GetDistance > satchedRange)
		{
			Log("come closer to spider");
			MovementManager.Go(path);
			while (spider.GetDistance > satchedRange && MovementManager.InMovement && Conditions.InGameAndConnectedAndAliveAndProductStartedNotInPause && !Conditions.IsAttackedAndCannotIgnore)
			{
				Thread.Sleep(1000);
			}
			return true;
		}
		MovementManager.StopMove();

		if (TraceLine.TraceLineGo(spider.Position))
		{
			Log("no line of sight. ignore");
			wManager.wManagerSetting.AddBlackList(spider.Guid, 1000 * 2 * 60);
			return true;
		}

		var cooldown = Lua.LuaDoString<double>("local startTime, duration, enable = GetItemCooldown(" + satchelId + "); return startTime + duration - GetTime();");
		if (cooldown > 0)
		{
			Log("satchel cd");
			return true;
		}

		Log("satchel use");
		ItemsManager.UseItem(satchelId);
		Thread.Sleep(Usefuls.Latency * 2);
		ClickOnTerrain.Pulse(spider.Position);
		Thread.Sleep(Others.Random(1500, 2000));
		return true;
	}

	WoWUnit Spider()
	{
		var spider = ObjectManager.GetNearestWoWUnit(ObjectManager.GetWoWUnitByEntry(spiderId));
		if (spider != null && spider.IsValid)
			return spider;

		return null;
	}

	public static void ChangeSettings()
	{
		Conditions.ForceIgnoreIsAttacked = true;
		Log("change settings");
	}

	public static void ResetSettings()
	{
		Conditions.ForceIgnoreIsAttacked = false;
		Log("restore settings");
	}

}

