public class WorkOrderRunescaleKoiFishingTurnIn : QuestClass
{
	int _questId = 41282;
	public WorkOrderRunescaleKoiFishingTurnIn()
	{
		Name = "Work Order: Runescale Koi (Fishing) (Turn In)";
		QuestId.Add(_questId);
		Step.AddRange(new[] { 1 });
	}
	public override bool CanConditions()
	{
		return WorldQuest.CompleteFishing(_questId, 1);
	}
	public override bool HasQuest()
	{
		return CanConditions();
	}
	public override bool IsComplete()
	{
		return WorldQuest.CompleteFishing(_questId);
	}
	public override bool IsCompleted()
	{
		return !CanConditions();
	}
	public override bool Pulse()
	{
		return TurnIn();
	}
}
